import Base from '../Base';

class BrokenLinksImagesPage extends Base {
    get brokenLinksImagesButton() {
        return $('//li[@id=\'item-6\']');
    }

    get images() {
        return $$('//p[contains(text(), \'Valid image\')]/following-sibling::img')
    }

    get validLink() {
        return $('//a[@href=\'http://demoqa.com\']');
    }

    get brokenLink() {
        return $('//a[@href=\'http://the-internet.herokuapp.com/status_codes/500\']');
    }

    clickbrokenLinksImagesButton() {
        this.brokenLinksImagesButton.click()
    }

    getImages() {
        return this.images
    }

    clickValidLink() {
        this.validLink.click()
    }

    clickBrokenLink() {
        this.brokenLink.click()
    }

    getBrokenLink() {
        return this.brokenLink
    }
}

export default new BrokenLinksImagesPage()

